ReactDOM.render(
  <React.StrictMode>
    <Grommet full theme={theme}>
      <BrowserRouter>

        <Switch>
          <Route path="/" exact component={App} />  
          <Route path="/home" component={Home}></Route>
          <Route path="/sign" component={Sign} />
